import {Link} from 'react-router-dom';
function Navbar() {
        return (
                <>
                        <nav className="navbar">
                                <div className="navbar-conatiner">
                                        <Link to="/" className="navbar-logo">
                                                TRVL <i className='fab fa-typo03' />
                                        </Link>
                                </div>
                        </nav>
                </>
        )
}

export default Navbar
